           <img src="https://mdbootstrap.com/img/Photos/Avatars/img%20(3).jpg" alt="Avatar" class="md-avatar rounded-circle"></img>
          <span className="d-none d-md-inline-block">Sierra Brooks</span>
        </DropdownToggle>
